import React from 'react';

function ProjectsPage() {
  return (
    <div className='ProjectsPage-main'>
      <div className='project'>
      <img src={require('../images/project1.jpg')} alt="profile pic" />
      <p>project description</p>
      </div>
    </div>
  );
}

export default ProjectsPage;
